import { useState, useEffect } from "react";
import axios from "axios";
import Voter from "../../components/Voter";


const ManageVoter = () => {
  let voterDataArray = [];
  const [voterData, setVoterData] = useState("");
  useEffect(() => {
    axios({
      method: "get",
      url: "http://localhost:3001/get-voter",
      responseType: "json",
    }).then((response) => {
        setVoterData(response.data.data);
    });
  }, []);

  const objToArray = (parameter) => {
    for (let index = 0; index < parameter.length; index++) {
      const element = parameter[index];

      voterDataArray.push(element);
    }
  };
  objToArray(voterData);

//   console.log(typeof candidateDataArray);
  return voterDataArray.map((item) => (
    <Voter
      name={item.name}
      address={item.address}
      social_number={item.social_number}
    />
  ));
};

export default ManageVoter;
